import { useSelector } from 'react-redux';
/* echarts */
 // 引入 ECharts 主模块
import echarts from 'echarts/lib/echarts';
// 引入环形图
import 'echarts/lib/chart/pie';
// 引入提示框和标题组件
import 'echarts/lib/component/tooltip';
import 'echarts/lib/component/title';
import 'echarts/lib/component/visualMap';

/* actions */
import {getOrder} from './state/reducer'
import { useDispatch } from 'react-redux';

const { RangePicker } = DatePicker;
export default function Order () {
  const orderList=useSelector(state=>state.order.list)
  const dispatch=useDispatch()
  /* eslint-disable */

  useEffect(async()=>{
    let result=await dispatch(getOrder('2020-10-29T08:28:34.125Z','2020-11-05T08:28:34.125Z'))
  },[])
  useEffect(()=>{
    console.log(orderList)
  },[orderList])

  function initCharts(){
    const data = this.props.data;
    var piedata = data.map((item, index) => {
      return {
        value: item.y,   //value和name是echarts规定的，呜呜呜
        name: item.x,
      };
    });
  }
  return (
    <div>
      <Space direction="vertical" size={ 20 }>
        <RangePicker style={{ width :'800px' }}/>
      </Space>
      <div className='main'>
        <div className='order-quantity' rfc={quantityRef}></div>
        <div className='order-people' rfc={peopleRef}></div>
      </div>
    </div>
  );
}
